import React from "react";

let Users = (props) => {
    return (
        <div>
            {
                props.users.map((user) => {
                    return (
                        <div key={user.id}>
                            <span>
                                <div>
                                    <img/>
                                </div>
                            </span>
                            <span></span>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Users;
